import './App.css';
import { Routes, Route, Link } from 'react-router-dom';
import Header from './header/Header';
import SignIn from './sign_up_in/SignIn.js';

function App() {
  return (
    <div className="">
      <Header/>
      <Routes>
        <Route path="/SignIn" element={<SignIn/>} />
      </Routes>
    </div>

  );
}

export default App;
